h; Please paste in the Diagnostic Info &amp; Error Log from your <strong>remote site</strong>.</p>\n</div>\n\n<div class=\"error submission-error both-diagnostic-same-error\" style=\"display: none;\">\n	<p><strong>Error!</strong> &mdash; Looks like you pasted the local Diagnostic Info &amp; Error Log into the textbox for the remote info. Please get the info for your <strong>remote site</strong> and paste it in, or just uncheck the second checkbox if you&#8217;d rather not include your remote site info.</p>\n</div>\n\n<form target=\"_blank\" method=\"post\" action=\"https://api.deliciousbrains.com/?wc-api=delicious-brains&request=submit_support_request&licence_key=2e01d63f-4e0c-4297-81fe-bab035324859&product=wp-migrate-db-pro\">\n\n	<div class=\"field from\">\n		<label>From:</label>\n		<select name=\"email\">\n		<option value=\"\">&mdash; Select your email address &mdash;</option>\n		<option value=\"alassetter@skyymedia.com\">alassetter@skyymedia.com</option>		</select>\n\n		<p class=\"note\">\n			Replies will be sent to this email address. Update your name &amp; email in <a href=\"https://deliciousbrains.com/my-account/\">My Account</a>.		</p>\n	</div>\n\n	<div class=\"field subject\">\n		<input type=\"text\" name=\"subject\" placeholder=\"Subject\">\n	</div>\n\n	<div class=\"field email-message\">\n		<textarea name=\"message\" placeholder=\"Message\"></textarea>\n	</div>\n\n	<div class=\"field checkbox local-diagnostic\">\n		<label>\n			<input type=\"checkbox\" name=\"local-diagnostic\" value=\"1\" checked>\n			Attach <strong>this site&#8217;s</strong> Diagnostic Info &amp; Error Log (below)		</label>\n	</div>\n		<div class=\"field checkbox remote-diagnostic\">\n		<label>\n			<input type=\"checkbox\" name=\"remote-diagnostic\" value=\"1\" checked>\n			Attach the <strong>remote site&#8217;s</strong> Diagnostic Info &amp; Error Log		</label>\n	</div>\n\n	<div class=\"field remote-diagnostic-content\">\n		<ol>\n			<li>Go to the Help tab of the remote site</li>\n			<li>Copy the Diagnostic Info &amp; Error Log</li>\n			<li>Paste it below</li>\n		</ol>\n		<textarea name=\"remote-diagnostic-content\" placeholder=\"Remote site&#8217;s Diagnostic Info &amp; Error Log\"></textarea>\n	</div>\n		<div class=\"submit-form\">\n		<button type=\"submit\" class=\"button\">Send Email</button>\n	</div>\n\n	<p class=\"note trouble\">\n		Having trouble submitting the form? Email your support request to <a href=\"mailto:priority-wpmdb@deliciousbrains.com\">priority-wpmdb@deliciousbrains.com</a> instead.	</p>\n\n</form>\n\n</section>\n\n	<aside class=\"additional-help\">\n		<section class=\"docs\">\n			<h1><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/\">Documentation</a></h1>\n			<ul class=\"categories\">\n				<li><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/getting-started/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\">Getting Started</a></li><li><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/debugging/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\">Debugging</a></li><li><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/cli/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\">CLI</a></li><li><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/common-errors/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\">Common Errors</a></li><li><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/howto/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\">How To</a></li><li><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/addons/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\">Addons</a></li><li><a href=\"https://deliciousbrains.com/wp-migrate-db-pro/docs/multisite/?utm_source=MDB%2BPaid&#038;utm_campaign=support%2Bdocs&#038;utm_medium=insideplugin\">Multisite<