olumn_inner][/vc_row_inner][/tab][/tabbed_section][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" top_padding=\"5%\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\" shape_type=\"\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][vc_custom_heading text=\"Frequently Asked Questions\" font_container=\"tag:h2|font_size:35px|text_align:center|color:%23756e67\" use_theme_fonts=\"yes\"][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" top_padding=\"5%\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\" shape_type=\"\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][vc_custom_heading text=\"TELADOC\" font_container=\"tag:h4|font_size:16px|text_align:left|color:%23756e67\" use_theme_fonts=\"yes\"][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"Do I talk to âreal doctorsâ?\"][vc_column_text]Yes. Teladoc members only talk to actual doctors who are U.S. board-certified internists, state-licensed family practitioners, and pediatricians licensed to practice medicine in the U.S. and living in the U.S. When you request a visit, Teladoc will connect you with a doctor licensed in your state.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"What are some of the common conditions Teladoc treats?\"][vc_column_text]Common conditions include sinus problems, respiratory infection, allergies, urinary tract infection, cold and flu symptoms and many other non-emergency illnesses.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Can Teladoc handle my emergency situations?\"][vc_column_text]Teladoc is designed to handle non-emergent medical problems. You should NOT use it if you are experiencing a medical emergency.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Can I speak with a specialist?\"][vc_column_text]You cannot request to speak with a specialist directly, but the doctors may be able to provide guidance on the type of specialist you should see.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Can I request a particular doctor?\"][vc_column_text]You cannot request a particular doctor. Teladoc is designed to support your relationship with your existing doctor. It is not a means of establishing an exclusive relationship with one of the doctors. Please know that all Teladoc doctors are highly qualified and go through rigorous training and credentialing. We have the largest physician network of any telehealth provider with board-certified, state-licensed doctors.[/vc_column_text][/toggle][/toggles][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"Can I get a prescription?\"][vc_column_text]Teladoc does not guarantee prescriptions. It is up to the doctor to recommend the best treatment. Teladoc doctors do not issue prescriptions for substances controlled by the DEA, non-therapeutic, and/or certain other drugs which may be harmful because of their potential for abuse. These include, but are not limited to, antidepressant drugs such as Cymbalta, Prozac and Zoloft which are drugs that are harmful due to their potential for abuse. Also, non-therapeutic drugs such as Viagra and Cialis are not prescribed by Teladoc doctors.\n\n<a href=\"https://www.deadiversion.usdoj.gov/schedules/orangebook/c_cs_alpha.pdf\">View the current list of DEA controlled substances Â»</a>[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Where do the prescription drugs come from?\"][vc_column_text]Teladoc does not dispense prescription drugs. The nurses call the prescription into the local pharmacy of your choice.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Is my electronic health record kept private?\"][vc_column_text]Health records are kept totally private and we employ robust encryption methods to protect your personal information. You determine who can see the information in your record.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Can I be turned down for a pre-existing condition?\"][vc_column_text]We do not turn patients away because of pre-existing conditions.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Can I call Teladoc outside of the United States?\"][vc_column_text]You can request a Teladoc visit from anywhere in the U.S. You will speak with a doctor licensed in your home state. You must have a U.S. address and a U.S.-based phone number for the doctor to call back at the time of visit.[/vc_column_text][/toggle][/toggles][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" top_padding=\"5%\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\" shape_type=\"\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][vc_custom_heading text=\"DOCTORS ONLINE\" font_container=\"tag:h4|font_size:16px|text_align:left|color:%23756e67\" use_theme_fonts=\"yes\"][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"How does this benefit work?\"][vc_column_text]Members can ask questions to a board certified doctor via email 24/7/365. After registering once, type in a subject, like poison ivy, and a question in the message field. A response from the doctor will be sent within 24 hours.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"What services are included?\"][vc_column_text]Simply call the toll free number on the back of the card 24 hours a day, 7 days a week to reach a counselor with outstanding educational credentials and professional experience. Starting with a national database of over 750,000 providers, the counselor will identify possible solutions and make between 20 to 30 calls to identify providers who match the specific family situation and ensure availability of care when it is needed.\n\nWithin 48 to 72 hours, a comprehensive referral packet is sent out. It contains profiles of providers who meet the familyâs needs, specifies availability of service, and includes educational materials to assist the family in making a decision about care. Two weeks later, the counselor follows up to determine if a decision has been made, if the member needs more referrals, and to answer any additional questions.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Are there any services with which Doctors Online will not help?\"][vc_column_text]Members may work with with a board certified doctor for guidance on treatment options for an illness. Members have access to psychologists for behavioral health questions and can get help with various other things including nutrition, fitness and much more.[/vc_column_text][/toggle][/toggles][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"Am I charged for each new question?\"][vc_column_text]No, members are never charged for services through Doctors Online. Members may use this service over and over at no cost.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Can I get general health info through Doctors Online?\"][vc_column_text]Yes, members may get info through e-mail, such as health tips, links to quality resources and responses from doctors.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Will the medical information I share remain confidential?\"][vc_column_text]Patient Confidentiality is respected by Doctors Online. The website honors or exceeds the legal requirements of medical/health privacy. Personal information will not be given or sold to unaffiliated third parties.[/vc_column_text][/toggle][/toggles][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" top_padding=\"5%\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\" shape_type=\"\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][vc_custom_heading text=\"WORKLIFE SERVICES\" font_container=\"tag:h4|font_size:16px|text_align:left|color:%23756e67\" use_theme_fonts=\"yes\"][/vc_column][/vc_row][vc_row type=\"in_container\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" overlay_strength=\"0.3\" shape_divider_position=\"bottom\" bg_image_animation=\"none\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"What is Worklife Services?\"][vc_column_text]Worklife Services is a comprehensive telephone consultation service providing research and referral information for child care, elder care and care for people with disabilities.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"How does the benefit work?\"][vc_column_text]Simply call the toll free number on the back of the card 24 hours a day, 7 days a week to reach a counselor with outstanding educational credentials and professional experience. Starting with a national database of over 750,000 providers, the counselor will identify possible solutions and make between 20 to 30 calls to identify providers who match the specific family situation and ensure availability of care when it is needed.\n\nWithin 48 to 72 hours, a comprehensive referral packet is sent out. It contains profiles of providers who meet the familyâs needs, specifies availability of service, and includes educational materials to assist the family in making a decision about care. Two weeks later, the counselor follows up to determine if a decision has been made, if the member needs more referrals, and to answer any additional questions.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"What types of problems does Worklife Services deal with?\"][vc_column_text]Expert counselors, experienced with the ins and outs of child and adult/elder care services, can help with:\n<ul>\n 	<li>Finding an in-home childcare provider for an infant or toddler</li>\n 	<li>Making transportation arrangements to the doctor for a disabled elder who is living alone in another state</li>\n 	<li>Understanding what Medicare, Medicaid or private insurance covers for an elderly relativeâs care and identifying programs that are available at little or no cost</li>\n 	<li>Finding an after-school program or summer camp for a child in elementary school</li>\n 	<li>Understanding the costs of various living arrangements if an elder adult can no longer live independently at home</li>\n 	<li>Finding care for a child or adult with a debilitating disease</li>\n</ul>\n[/vc_column_text][/toggle][/toggles][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\" bg_image_animation=\"none\"][toggles style=\"minimal\"][toggle color=\"Extra-Color-2\" title=\"What can I expect in the Provider Profile Packet?\"][vc_column_text]The packet contains profiles with each providerâs name, address, contact, title, services provided, applicable fees, and any other special comments. Depending on the services required members might receive additional information such as CPR/ First Aid certification information and admission requirements for a childcare center.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"What can I expect in the Educational Materials Packet?\"][vc_column_text]The Educational Materials Packet Members includes comprehensive notes and guidebooks covering a broad range of dependent care topics.[/vc_column_text][/toggle][toggle color=\"Extra-Color-2\" title=\"Is there someone I can turn to with questions about my Worklife Services benefit?\"][vc_column_text]Yes. Simply call the toll-free number on the back of your membership card and an experienced counselor can help with any questions or concerns.[/vc_column_text][/toggle][/toggles][/vc_column][/vc_row]\";}}","no"),
